import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import LandingPage from './components/LandingPage';
import UserLogin from './components/UserLogin';
import TourismAgentLogin from './components/TourismAgentLogin';
import AirlineAgentLogin from './components/AirlineAgentLogin';
import FlightAttendantLogin from './components/FlightAttendantLogin';
import SystemAdminLogin from './components/SystemAdminLogin';

const App = () => {
  return (
    <Router>
      <div>
        <Route exact path="/" component={LandingPage} />
        <Route path="/user" component={UserLogin} />
        <Route path="/tourismAgent" component={TourismAgentLogin} />
        <Route path="/airlineAgent" component={AirlineAgentLogin} />
        <Route path="/flightAttendant" component={FlightAttendantLogin} />
        <Route path="/systemAdmin" component={SystemAdminLogin} />
      </div>
    </Router>
  );
};

export default App;
